import React from 'react';
import Map2GIS from './Map2GIS';
import './MapSize.css'; // подключаем CSS
import PropertyCard from './PropetyCard';

function MapSize() {
  return (
    <div className="container">
      <div className="text">
        <h1>Привет, мир!</h1>
        <p>Это базовый функциональный компонент на JSX.</p>
      </div>
      <div className="map">
        <Map2GIS />
      </div>
      <PropertyCard />
    </div>
  );
}

export default MapSize;
